import {
    createBrowserRouter,
    RouterProvider,
    createRoutesFromElements,
    Route,
} from "react-router-dom"
import Home from "./routes/Home";

function App() {
    const router = createBrowserRouter((
        createRoutesFromElements(
            <Route path="/" element={<Home />}>

            </Route>
        )
    ));
    return <RouterProvider router={router} />
}

export default App;
